import { Container, Navbar } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import "./header.css"


const Header = () => {
    return (<>
        <Navbar bg="primary" variant="dark" >
            <Container>
                <Navbar.Brand to="/"><strong>Sistema para empleados</strong></Navbar.Brand>
                <Nav classname="nl-auto">
                    <Nav.Link as={link} to="/" classname="nav-link">Empleados</Nav.Link>
                    <Nav.Link as={link} to="/empleados" classname="nav-link">Cargar Empleados</Nav.Link>

                </Nav>
            </Container>
        </Navbar >
    </>
    )
}

export default header;
